"original": |2-
     An int-range is a range expressed as two non-negative integers or as
     one non-negative integer through to the end of the representation
     data.  The range unit specifies what the integers mean (e.g., they
     might indicate unit offsets from the beginning, inclusive numbered
     parts, etc.).
"fixed": |-
  An int-range is a range expressed as two non-negative integers or as one non-negative integer through to the end of the representation data.  The range unit specifies what the integers mean (e.g., they might indicate unit offsets from the beginning, inclusive numbered parts, etc.).
"ko": |-
  int-range는 표현 데이터의 끝까지 음이 아닌 두 개의 정수 또는 음이 아닌 하나의 정수로 표현되는 범위입니다. 범위 단위는 정수의 의미를 지정합니다(예: 처음부터의 단위 오프셋, 숫자가 지정된 부분 포함 등을 나타낼 수 있음).
